import React from "react";
import { Switch } from "react-router";
import {
  BrowserRouter as Router,
  Route,
  Link
} from "react-router-dom";
import { Helmet } from 'react-helmet'
// navbar images 
import Logo from '../src/images/logo.png'
// pages 
import Domain from './Components/Domain'
import HomePage from './Components/Main'
import Shared from './Components/Shared'
import AffiliateHome from "./Components/AffiliateHome";
import ResellerMain from "./Components/ResellerMain";
import DedicateMain from "./Components/Dedicate";
import VpsMain from './Components/VpsHome'
// loader 
import Loader from "react-loader-spinner";

export default function App() {

    // <!--Start of Tawk.to Script-->
var Tawk_API=Tawk_API||{}, Tawk_LoadStart=new Date();
(function(){
var s1=document.createElement("script"),s0=document.getElementsByTagName("script")[0];
s1.async=true;
s1.src='https://embed.tawk.to/5d7e91079f6b7a4457e1cadb/default';
s1.charset='UTF-8';
s1.setAttribute('crossorigin','*');
s0.parentNode.insertBefore(s1,s0);
})();
// <!--End of Tawk.to Script-->

  return (
    <Loader
    type="Puff"
    color="#00BFFF"
    height={100}
    width={100}
    timeout={3000} //3 secs
  />,
    <Helmet>
<meta property="og:image" content={Logo} />
</Helmet>,
    <Router>
      <div>

        <Switch>
        <Route path="/dedicate">
            <Dedicate />
          </Route>
          <Route path="/vps">
            <VPS />
          </Route>
          <Route path="/affiliate">
            <Affiliate />
          </Route>
          <Route path="/reseller">
            <Reseller />
          </Route>
          <Route path="/domain">
            <Domain />
          </Route>
          <Route path="/hosting">
            <Hosting />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <HomePage/>;
}
function Hosting() {
  return <Shared/>;
}
function Reseller() {
  return <ResellerMain/>;
}
function Affiliate() {
  window.scrollTo(0, 0);
  return <AffiliateHome />;
}
function VPS() {
  return <VpsMain/>;
}
function Dedicate() {
  return <DedicateMain/>;
}
